import React from 'react';
import classes from './Layout.module.css';

const Layout = (props) => {
    return (
        <React.Fragment>
            <div>Toolbar, SideDrawer, Backdrop</div>
            <main className = {classes.mainContent} >
                {props.children}
            </main>
        </React.Fragment>
    )
}

export default Layout
